import "./App.css";
import Video from "./components/Video/Video";

const tiktokData = [
  {
    urlVideo:
      "https://v16-webapp.tiktok.com/a7e4ecdf41973a18b09a046114b95428/6255f3b1/video/tos/useast2a/tos-useast2a-pve-0037-aiso/d981231f4f714cb48ec4b1f72af237ee/?a=1988&br=2534&bt=1267&cd=0%7C0%7C1%7C0&ch=0&cr=0&cs=0&cv=1&dr=0&ds=3&er=&ft=eXd.6Hk_Myq8ZVe_hwe2N1KUml7Gb&l=202204121547340102452480470F271667&lr=tiktok_m&mime_type=video_mp4&net=0&pl=0&qs=0&rc=anh3bjM6ZmZsOjMzZjgzM0ApNzU3PDc8OTs0NztpOmZnOGdxcTFpcjRnNmxgLS1kL2NzczYyMTAuYmE1Ni8xY2NeNl86Yw%3D%3D&vl=&vr=",
    urlAvatar: "https://picsum.photos/200/300",
    userName: "Phuong Nguyen",
    userId: "phuongcf1998",
    musicName: "Originalton - 🔥Yujiro🔥",
    tagId: "#fyp #xuhuong #meme",
  },
  {
    urlVideo:
      "https://v16-webapp.tiktok.com/9561b974ebb42d9a17db6ed7c5e6acb1/6255dc01/video/tos/useast2a/tos-useast2a-pve-0037-aiso/962ed22e02b04fafb9b2fdd7049f8d9b/?a=1988&br=2090&bt=1045&cd=0%7C0%7C1%7C0&ch=0&cr=0&cs=0&cv=1&dr=0&ds=3&er=&ft=eXd.6Hk_Myq8Zv82hwe2NlAnml7Gb&l=202204121406320102450101811E191823&lr=tiktok_m&mime_type=video_mp4&net=0&pl=0&qs=0&rc=and2dzc6Zmh0OzMzZjgzM0ApZ2Y8OzY5NTxlN2c4NjU0N2c0cGpvcjQwLjRgLS1kL2Nzc2AtYF80MWNjYDViLmIxNDY6Yw%3D%3D&vl=&vr=",
    urlAvatar: "https://picsum.photos/200/300",
    userName: "Phuong Tran",
    userId: "phuonglmht988",
    musicName: "nhạc nền - Lương Gia Kính ☑️",
    tagId: "#nguoithanhcong #mrbabibill",
  },
];

function App() {
  return (
    <div className="App">
      {tiktokData.map((item) => (
        <Video
          urlVideo={item.urlVideo}
          urlAvatar={item.urlAvatar}
          userName={item.userName}
          userId={item.userId}
          musicName={item.musicName}
          tagId={item.tagId}
        />
      ))}
    </div>
  );
}

export default App;
